agreementText2:"1、外网测速功能由中国信通院提供，测速结果与TP-LINK无关。测速功能仅供参考。建议关闭手机和电脑等终端的视频和下载功能以提高测速准确率。",agreementText3:"2、您同意将测速过程中产生的如下的数据信息由中国信通院自动采集并处理：<br>1）部分测速结果<br>2）您使用的运营商的ID（从您的宽带运营商获取）<br>3）您的路由器品牌、设备ID<br>4）您所在的国家、省份、城市（从您的宽带运营商获取）如果您选择不提供或不同意中国信通院搜集上述信息，将导致测速功能无法正常运行，中国信通院无法为您提供服务。",agreementText4:"3、除非获得您的明示同意，TP-LINK不会保存测速功能的任何用户数据。",agreementText5:'4、关于个人信息的更多处理规则，请您在TP-LINK APP的《隐私政策》中查看。如果您对本须知或您个人信息的相关事宜有任何问题、意见或者建议，请发送邮件至service@tp-link.com.cn或拨打<a class="phoneNumber">400-8863-400</a>与我们联系。',
agreementText6:"涉及到您的个人敏感信息时，我们会在转让前，单独征得您的授权同意。",speedTestAgreement:"《TP-LINK网速测试用户须知》",historyData:"历史记录",historyPanelTitle:"历史记录",modifyPanelTitle:"编辑备注",noHistoryData:"暂无历史记录",sfpRate:"SFP口速率",sfpInfo:"仅显示拥有SFP口的路由，默认速率为自动",routerName:"路由名称",mainRouter:"(主路由)",autoDefault:"自动(默认)",setSuccess:"设置成功",gamePort:"游戏专用口",iptvUp:"IPTV上联口",iptvDown:"IPTV口",lagPort:"聚合口",selectWan:"请选择WAN口",wan1Port:"WAN1口",wan2Port:"WAN2口",wan1PhyErr:"WAN1口无网线连接",wan2PhyErr:"WAN2口无网线连接",disconnectWarning:"您与路由器的链接已断开，请重新连接并刷新页面。",
